import React, { Component } from 'react'

export default class Edit extends Component {

    constructor() {
        super()

        this.state = {
            weight_logs: 0,
            body_fat_logs: 0

        }
    }

    handleWeight(e){
        this.setState({ weight_logs: e})

    }

    handleBodyFat(e) {
        this.setState({body_fat_logs: e})
    }



    render() {
        return (
            <div>
                <form>
                    Weight <input className='modal' type="text" onChange={(e) => {this.handleWeight(e.target.value)}} />
                    Body Fat <input className='modal' type='text'  />
                    <button>Submit</button>
                </form>



            </div>
        )
    }
}
